import React from "react";
import ReactDOM from "react-dom"
import App from "./App";

import { library } from '@fortawesome/fontawesome-svg-core'
import { fab, faYoutube, faGithub, faFreeCodeCamp } from '@fortawesome/free-brands-svg-icons'
import { faFileDownload, faUser, faServer} from '@fortawesome/free-solid-svg-icons'

library.add(fab, faFileDownload, faUser, faServer,  faYoutube, faGithub, faFreeCodeCamp  )

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
